import loginForm from "./loginform"



const LoginForm = (props) => {
    const styles = {
        display: "flex",
        justifyContent: "center",
        alignItems:"center",
    }
	return (
		<div style={styles}>
			<Container>
				<LoginForm />
				<div>
					<p>
						Don't have an account? <Link to="/register">Register</Link>.
					</p>
				</div>
			</Container>
		</div>
	);
};

export default LoginForm;
